import CloseRoundedIcon from '@mui/icons-material/CloseRounded';
import { Link } from 'react-router-dom';
import InputBase from "@mui/material/InputBase";

export const CreateRecipeBlock = () => {
    return (
        <div style={{ 
            border: '2px solid black',
            width: '100vw',
            height: '100vh',
            position: 'fixed',
            top: '0px',
            left: '0px',
            display: 'flex',
            justifyContent: 'center',
            background: 'rgba(0,0,0,.5)',
        }}>
            <div style={{
                backgroundColor: '#FFFFFF',
                position: 'absolute',
                top: '10%',
                width: '50%',
                minHeight: '60%',
                borderRadius: '20px',
            }}>
                <div style={{
                    position: 'absolute',
                    top: '16px',
                    right: '16px',
                }}>
                    <Link to='/profile'>
                        <CloseRoundedIcon style={{
                            color: '#000000',
                        }}/>
                    </Link>
                </div>
                <InputBase
                    sx={{m: 0, width: '100%'}} placeholder="Введите название"
                />
            </div>
        </div>
    )
}
